What does my fueling look like for my upcoming 48 hour race? 

@gnarlynutrition for physical energy
@hvmn ‘s Ketone-IQ for mental focus
@slatemilk for extra protein and it tastes darn good
Also peanut butter & jelly, avocados, bananas, & @eatbobos oat bars.

What’s your favorite way to fuel while running? Let me know in the comments & don’t forget to guess my mileage before the race tomorrow!

Tomorrow we rage 🤘 @cocodona250 

250 miles to run, with the best crew in my corner.  No expectations except making memories and redefining what living feels like. 

